Notice the Stage Indicator on the lower-left corner. It shows the currently active stage. Since we haven't launched yet, it's showing the first stage to be activated. I have your staging controls locked for now, so the LED next to the indicator is glowing purple. 

One more thing on staging, if the automatically generated stage setup, or even one made by you, is causing strife, or you just changed your mind about something, you can edit the stage sequence on the fly...pun intended...no need to go back to the assembly facility.

